import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar3 from "./Navbar3";
import { Link } from "react-router-dom";
import Adminbar from "./Adminbar";
// import { Nav, NavDropdown, Dropdown, DropdownButton, Button } from 'react-bootstrap';

const Managerform=()=>{
    const navigate = useNavigate();
    const [manager,setmanager]=useState(
        {
            firstName:"",
            lastName:"",
            emailId:"",
            managerId:"",
            password:"",
            role:""
           
        }
    )
    const { firstName,lastName, emailId,managerId,password,role}=manager
    const[isFormValid,setIsFormValid]=useState(false);
    const[errors,setErrors]=useState({});
    const validateForm =()=>{
        const errors={};
        if(! firstName){
            errors. firstName=' firstName is required';
        }
        if(! lastName){
            errors. lastName=' lastName is required';
        }
        if(! emailId){
            errors. emailId=' Email Id is required';
        }
        if(!password){
            errors.password='password is required';
        }
        if(!role){
            errors.role='Role is required';
        }
        if(!managerId){
            errors.managerId='Id is required';
        }
        setErrors(errors);
        setIsFormValid(Object.keys(errors).length===0);
    };
    const onInputChange=(e)=>{
        setmanager({...manager,
            [e.target.name]:e.target.value
        });
    }
    const handleSubmit= async (e)=>{
     e.preventDefault();
     await axios.post(`http://localhost:8080/admin/manager/addmanager`,{
        "firstName":firstName,
        "lastName":lastName,
        "emailId":emailId,
        "managerId":managerId,
        "password":password,
        "role":role,
    }
     )
     .then(res=>{
        console.log(res.data)
        if(res.status===404){
            alert(res.data)
        }
    })
    .catch(error=>{
        console.log(error)
    })
    navigate("/getallmanagers");
  
    };
    return (
        <div>
            <Adminbar></Adminbar>
            <div className="container"style={{marginTop:'6rem'}}>
            <div className="row">
                <div  className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow bg-success p-2 text-dark bg-opacity-10">
                    <h2  className="text-center m-4"> Register Manager  </h2>
                    <form onSubmit={(e)=>handleSubmit(e)}>
                    <div className="mb-3">
                       <b><label htmlFor="firstName" className="form-label">FirstName</label></b>
                        
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter Firstname"
                        name="firstName"
                        value={firstName}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    <div className="mb-3">
                        <b> <label htmlFor="lastName" className="form-label">LastName</label></b>
                       
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter Lastname"
                        name="lastName"
                        value={lastName}
                        onChange={onInputChange }
                        ></input>
                    </div>
                    <div className="mb-3">
                        <b> <label htmlFor="emailId" className="form-label">EmailId</label></b>
                       
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter Emailid"
                        name="emailId"
                        value={emailId}
                        onChange={onInputChange }
                        ></input>
                    </div>
                    <div className="mb-3">
                        <b><label htmlFor="managerId" className="form-label">managerId</label></b>
                        
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter ManagerId"
                        name="managerId"
                        value={managerId}
                        onChange={onInputChange }
                        ></input>
                    </div>
                    <div className="mb-3">
                        <b><label htmlFor="password" className="form-label">Password</label></b>
                        
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter Password"
                        name="password"
                        value={password}
                        onChange={onInputChange }
                        ></input>
                    </div>
                    <div className="mb-3">
                        <b><label htmlFor="role" className="form-label">Role</label></b>
                        
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter Role"
                        name="role"
                        value={role}
                        onChange={onInputChange }
                        ></input>
                    </div>
                    {/* <div className="mb-3">
                        <label htmlFor="dateOfBirth" className="form-label">dateOfBirth</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="dateOfBirth"
                        value={dateOfBirth}
                        onChange={dateOfBirthhandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="address" className="form-label">address</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="address"
                        value={address}
                        onChange={addresshandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="city" className="form-label">city</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="city"
                        value={city}
                        onChange={cityhandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="state" className="form-label">state</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="state"
                        value={state}
                        onChange={statehandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="pinCode" className="form-label">pinCode</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="pinCode"
                        value={pinCode}
                        onChange={pinCodehandler}
                        ></input>
                        
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="country" className="form-label">country</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="country"
                        value={country}
                        onChange={countryhandler}
                        ></input>
                    </div> */}
                    <button type="submit" className="btn btn-outline-info">Submit</button>
                            {/* <Link to="/"type="submit" className="btn btn-success">Submit</Link> */}
                            <Link to="/AddEmployee" type="submit" className="btn btn-outline-danger mx-2">Cancel</Link>
                    </form>
                </div>

            </div>
        </div> 
        </div>
    );
    
}
export default Managerform;
